import "./Adminpanel.css";

export const AdminPanel = () => {
  return (
    <div>
      <table className="administrator-table">
        <tr>
          <th>id</th>
          <th>Наименование</th>
          <th>Категория</th>
          <th>Стоимость</th>
          <th>Кол-во</th>
          <th>Фото</th>
          <th>Действия</th>
        </tr>
        <tr>
          <td>Ячейка 4</td>
          <td>Ячейка 5</td>
        </tr>
      </table>
    </div>
  );
};
